In C#, using the Math class, we can calculate the Fibonacci sequence up to a given number. For instance, to find the first 10 numbers in the Fibonacci sequence, you can write:

```csharp
int num1 = 0, num2 = 1, next;
for (int i = 0; i < 10; i++)
{
    next = num1 + num2;
    Console.WriteLine(next);
    num1 = num2;
    num2 = next;
}
```

This code initializes the first two numbers in the sequence and then uses a for loop to calculate and print the next eight numbers by adding the previous two numbers together and storing the result as the new next number.
